
// Division.

// ****************************************************************************************************
mdnum8_t mdnum8_div_ro(coeff_t num, mdnum8_t* den){

    
    mdnum8_t inv = mdnum8_pow(den,-1);
    mdnum8_t res = mdnum8_mul_ro(num,&inv);

    return res;

}
// ----------------------------------------------------------------------------------------------------

// ****************************************************************************************************
mdnum8_t mdnum8_div_oo(mdnum8_t* num, mdnum8_t* den){

    
    mdnum8_t inv = mdnum8_init();
    mdnum8_pow_to(den,-1,&inv);
    mdnum8_t res = mdnum8_mul_oo(num,&inv);
    
    return res;

}
// ----------------------------------------------------------------------------------------------------

// ****************************************************************************************************
mdnum8_t mdnum8_div_or(mdnum8_t* num, coeff_t val){

    return mdnum8_mul_ro(1.0/val,num);

}
// ----------------------------------------------------------------------------------------------------

// ****************************************************************************************************
mdnum8_t mdnum8_abs(mdnum8_t* num){

	mdnum8_t res;
    mdnum8_abs_to(num,&res);
    return res;

}
