mdnum8_t mdnum8_feval(coeff_t* feval_re, mdnum8_t* x){

  mdnum8_t res;

  // feval function
  //  Definitions
  coeff_t factor=1, coef = 0;
  mdnum8_t deltax = (*x), deltax_power = (*x);
  deltax.r = 0.0;
  deltax_power.r = 0.0;
  mdnum8_set_r(0.0, &res);
  //  Real
  res.r = feval_re[0];
  // Order 1
  factor *=1;
  coef    = feval_re[1]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);
  deltax_power = mdnum8_mul_oo(&deltax_power,&deltax);
  // Order 2
  factor *=2;
  coef    = feval_re[2]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);
  deltax_power = mdnum8_mul_oo(&deltax_power,&deltax);
  // Order 3
  factor *=3;
  coef    = feval_re[3]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);
  deltax_power = mdnum8_mul_oo(&deltax_power,&deltax);
  // Order 4
  factor *=4;
  coef    = feval_re[4]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);
  deltax_power = mdnum8_mul_oo(&deltax_power,&deltax);
  // Order 5
  factor *=5;
  coef    = feval_re[5]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);
  deltax_power = mdnum8_mul_oo(&deltax_power,&deltax);
  // Order 6
  factor *=6;
  coef    = feval_re[6]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);
  deltax_power = mdnum8_mul_oo(&deltax_power,&deltax);
  // Order 7
  factor *=7;
  coef    = feval_re[7]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);
  deltax_power = mdnum8_mul_oo(&deltax_power,&deltax);
  // Order 8
  factor *=8;
  coef    = feval_re[8]/ factor;;
  mdnum8_gem_ro_to( coef, &deltax_power, &res, &res);

  return res;

}

